import logo from './logo.svg';
import './App.css';
import Header from './components/Header.js'
import Footer from './components/Footer.js'

function App() {
  return (
	  <>
		  <div className="header">
			  <Header />	
		  </div>
		  <div className="footer position-absolute bottom">
			  <Footer />
		  </div>
	  </>
  );
}

export default App;
